//henrycc24.github.io/Labs/lab2/":{"tf":1.0}},"df":1},"4":{"docs":{"https://henrycc24.github.io/Labs/lab4/":{"tf":1.0}},"df":1},"5":{"docs":{"https://henrycc24.github.io/Labs/lab5/":{"tf":1.0}},"df":1},"7":{"docs":{"https://henrycc24.github.io/Labs/lab7/":{"tf":1.0}},"df":1},"8":{"docs":{"https://henrycc24.github.io/Labs/lab8/":{"tf":1.0}},"df":1},"f":{"docs":{},"df":0,"a":{"docs":{},"df":0,"s":{"docs":{},"df":0,"t":{"docs":{"https://henrycc24.github.io/":{"tf":1.0}},"df":1}}}},"l":{"docs":{},"df":0,"a":{"docs":{},"df":0,"b":{"docs":{"https://henrycc24.github.io/Labs/":{"tf":1.0},"https://henrycc24.github.io/Labs/lab1/":{"tf":1.0},"https://henrycc24.github.io/Labs/lab10/":{"tf":1.0},"https://henrycc24.github.io/Labs/lab12/":{"tf":1.0},"https://henrycc24.github.io/Labs/lab2/":{"tf":1.0},"https://henrycc24.github.io/Labs/lab4/":{"tf":1.0},"https://henrycc24.github.io/Labs/lab5/":{"tf":1.0},"https://henrycc24.github.io/Labs/lab7/":{"tf":1.0},"https://henrycc24.github.io/Labs/lab8/":{"tf":1.0}},"df":9,"3":{"docs":{"https://henrycc24.github.io/Labs/lab3/":{"tf":1.0}},"df":1}}}},"r":{"docs":{},"df":0,"o":{"docs":{},"df":0,"b":{"docs":{},"df":0,"o":{"docs":{},"df":0,"t":{"docs":{"https://henrycc24.github.io/":{"tf":1.0}},"df":1}}}}}}}},"documentStore":{"save":true,"docs":{"https://henrycc24.github.io/":{"body":"This course focuses on autonomous robots, in which we explore it through making an autonomous car ourselves. Each lab building off eachother and creating a learning environment that involves forces, sensors, adurinos, and embedded processors. We will endeaver in how to reduce noise in sensors, and using C to program our robots. Come and take a look at my expierence throughout the labs for this semester.\n","id":"https://henrycc24.github.io/","title":"Fast Robotics"},"https://henrycc24.github.io/Labs/":{"body":"","id":"https://henrycc24.github.io/Labs/","title":"Labs"},"https://henrycc24.github.io/Labs/lab1/":{"body":"\nLab1: The Artemis Board and BlueTooth\n\nPrelab\nBefore starting the lab we had to setup our computers in order for us to work with the Adruino. Doing this requrired us downloading the Arduino IDE. Luckily for me even though I have a Mac, I haven't updated it in years, so I don't have to download any additional drivers. Getting that out of the way, next I had to setup my environemnt in Python in order to send and recieve messages from the ardruino, Having Pip and Python latest versions already installed all I had to do was download the virtual environment (activate it), downlaod the necessary python packages, the codebase, and Jupyter Notebook.\n\nThe codebase we are working in is ble_arduino where it has the files ble_arduino.ino, BLECstringCharacteristic.h, EString.h, RobotCommand.h which to sum up do:\nRobotCommand.h\n\nUsed when Artemes recieves string format of\n\n\n\nrobot_cmd(:|) whrere \":l\" is deilmiter\n&lt;cmd_type&gt; is an int and  can be either an int, float, string\nMain way we will by sending commands in jupyter notebook\n\nEString.h.h\n\nUsed to manipulate char arrays\nprovides getter and setter functions\nClear(), append(), c_str(), are all used throuhgout to send charracter arrays.\nUsed to transmit strings from the Artemis to the computer (main way we recieve data in lab)\n\nBLECstringCharacteristic.h\n\nUse to receive data from the artemis\nwriteValue(value): the value is what we transmit to the computer\n\nble_arduino.ino\n\nMain file we will be editing and connecting though our Artemis wth BLE\nContains our UUIDS (University unique identifiers)\n\nFurthermore, we had to configure ble_arduino such that we print our unique MAC_ADDRESS and create a new UUID. This is to make sure that we only connect to our device and not the rest of the students in the lab. Changing this in our ble_arduino.ino and Juptyer Notebook, now allowed us to our tasks.\nTasks\nLab 1A\nThe first lab we look into the examples given in the Ardruino library to test out our Artemis capabilities.\n1. Blink\n\nThe first example we tested was blinking an LED, as shown above and here is where I configured my Baud rate to 115200 in order to properly work.\n2. Serial Monitor\n\nNext, we opened over the serial monitor and making sure the baud is right we are able to type messages inside of it as shown in the video.\n3. Temperature Sensor\n\nHere we test our temperature sensor, by placing our finger on top of it and seeing the it rise and fall as we move it off/on it.\n4. Microphone\n\nLastly, we test to see if our microphone is working by checking if there is a change in frequency due to sound. As seen in the video I attempted to whistle, and there was some change, so I'll take it.\nLab 1B\n1. ECHO\nThe first command we implemented was ECHO. This just ment that we would send a string to our Artemis and it will reply with \"Robot says -&gt; string sent\".\n\n\nThe above image showcases how we clear our char array and then append \"Robot says\", with the next line adding our message then sending that whole char array back to us. With the other image showing what we receive.\n2. SEND_THREE_FLOATS\n\nNext we had to send three floats to the Artemis, and it had to extract each individual value. Knowing that | seperates values, we send three floats with | in between, and with the .get_next_value cmd we can seperate each one simply.\n\n3. GET_TIME_MILLIS\nNext, we implement a command to fetch time in ms. Like earlier we will simply use the function millis(), andn append it into a character array with T:.\n\n\n4. Notifciation Handler\nWe then setup a notifcation handler, where it will receive the stringss from the Artemis board sends, and then configure it to split the data so we can use it. This is down by using .split, and then later we append them to lists.\n\nHere it is being used to print out time in ms automatically for us.\n\n5. Time Loop\n\nNow we need to create a loop that sends out current time in ms. Using our functions from before, we simply create a while loop with us looping until we hit 10000. I used 10000 because, 10000/1000 = 10 seconds which is a very nice number to divide with. Incrementing int i to know how many messages are sent, at the end we were able to send 500 messages in 10 seconds. Which means ~ 50 msgs/s. The size of the char array I sent was 9, meaning 9 bytes per message so 450 bytes per message is the data transfer rate i got.\n6. Time Array\nWith creating a time loop, now we need to store these times into an array. To do this first you have to create a global variables:\n\nI choose to gather 1000 max samples of time so I don't take to long sending/gathering data. Next simply we just createa a foor loop that iterating thorugh the array as shown below.\n\nNext to send a data, we just create a similar loop, but this time instead of placing values into our array we read our time_array values using a for loop. Then like before we appendn them as character arrays and send that message to the computer.\n\nHere what we see on our side when we call it (Using the notificatoin handler)\n\n7. Time and Temp Array\nNow, we have to integrate getting temperature at the same tie as getting our time stamps. Using a similar method of creating an array, and then looping thorugh it as we did time we have as shown below with the same array size. Using millis() to get time and getTempDegF() to get temperature.\n\n\nAfter creating our array, we use the same method as time, we just append our temperature to the char array and send it to the computer.\n\nThis is what it looks like from our side when we call the command!\n8. Pros/Cons\nThe two methods we explore is sending data while collecting it (live), and gathering the data into a array, and then sending the array. When it comes to having a large amount of data that you want to send it is best to gather it an array since you will collect way more data in a given time. Experimenting with sending data and then sending, if you do it in a for loop it will take signficianlty longer. The for loop has to iterate through to gather each data, and then send the data in char arrarys to the computer which take ages. However, if you just append all the data into an array and have a seperate command to send it then you won't face that time hold up! Meaning if you want more data per second, and you want to gather a lot then use an array first then send it. However, if you're only looking at a few values then doing it live won't cause to much time delay. It better to do live sending when first implementing functions/sensors to make sure they're operating properly. However, once you know they are set up correct, then I would switch out the send statements so you can gather more data.\nDiscussion\nIn this lab I wanted to experiment with typedef struct, which can be seen above when I was gather Temp and Time. I thought that maybe, this would save me some time and be easier, however, I was completely wrong. It felt way more complicated using my own type, instead of simply using creating another array, which trust me I learned for future labs. I also tinkered with how much bytes a message could send and if that would affect its msg rate. I went up to 15 bytes of data per msg and didn't see to much of a change from the orignal, however,i didn't limit test it as I would've liked to. Which makes me wonder what is the max for it, which I feel like I'll find out bby mistake.\n","id":"https://henrycc24.github.io/Labs/lab1/","title":"Lab 1"},"https://henrycc24.github.io/Labs/lab10/":{"body":"\nLab8 : Bayes Filterization\n\nTasks\nLab 10\nA. Compute Control\nThe first function we had to create was compute control. This function takes in 2 inputs of the previous and current odomoetry positions of the robot state. Since in this simulation the roboto state is given as (x, y, theta) it made it easy to to return the control information. Following the formulas provied in lecture, it was easy to calculte the inital rotioatn, translation, and final rotation. Keeping in mind that odometry is used after the robot itself moved making it useful for us in this lab for localizaiton, and recontructing the motion between 2 robot states.\n \n**B. Odom Motion Model **\n \nThe next function we created was to see the probabilty of our current position given our prev position and the control read up by the odometer. We calculate what we ideally should've done for control using our previous function and the inputs of prev_pose and cur_pose. Then we compare this to what the odometer read since the odometer does have some noise. Getting the probailty of the ideal motion done vs what was given by multiplying each parameter's probility using gaussian. Giving us our transition probabilituy used for our predition step for our prior belief calculation. The probabilty that our robot is in state x given the previous state and control u. p(x | x' u)\nC. Prediction Step\n \nNext, we computed the previous belief by calucalting the  prediction step. Since we already set up a function to get the probailty of transition, all we had to do is multiply this probility with the belief of the previous state. However since we have around 2000 states to iterate to calculate a belief, we included a threshold as the lab suggested to ignore and probilites less then .0001 since they didn't contribute much to our beliefs. However we did have to normalize it at the end to make sure it still all added up to 1.\nD. Sensor Model\n \nNext in order to calculate the update step we need to find the measurement probabilty p(z |x). This essentially is how measurments are generated based on the robots state. To do this simply we found the probabilty using a gaussian distrubtion with the true observations, collected observations, and standard deviation of sensor noise.\nE. Update Step\n\nFinally with sensor model we just needed to calculate the update step portion to get the belief. To do this we multiplied our measuremnt probability with our prior belief similary as our last functino we have do to it about 2000 times. However, no summation is needed allowing us to use simpler code. Getting our observed sensor reading and then getting the proabilitiy with our snsor model function, we multiplity it with our prior belief to get us our beliefs. As showcased in the formula below.\nBayes Filter\nAfter finishing the update step now we have all the components in order to use bayes filter which fundamental algorithm for estimating a robots state (location) under uncertainty by continually predicting where it might have gone and then correcting with whatever measurements it actually observes. The odometer as can be seen in the video and images below is very noisy/innacurate (red) however, despite that bayes filter is able to overcome it and give a pretty decent estimation on the robot's state (blue) which closely followed the true path green.\n\n\n\nsome key factors that helped out is that we knew the intial state of our robot for this simulation, we could calculate our inital belief which is required for the algorithim to work intially.\n","id":"https://henrycc24.github.io/Labs/lab10/","title":"Lab 10"},"https://henrycc24.github.io/Labs/lab12/":{"body":"\nLab 12 : Path Planning and Execution\n\n\nThe final lab in which we have to naviagite throghout the waypoints in as fast and accurate manner as possible. Here the image of the bath that we had to follow through. Starting from the bottom left and naviagting in a loop and ending at the center of the map.\nThis lab I worked with Jorge Corpa and used his car for the video since my car orientation didn't work as smoothly as Jorge's. Jorge's orientation was much better then mine, and was mucuh easier to work with and debug. Sadlt I couldn't get Lil Homie working with the orientation and gave up.\nLab 12\n**A. Theory crafting **\nThroughout this lab I worked with several of my friends and brainstormed numerous methods of accomplishing this lab. Since I had back to back finals on this my friends had an early head start in which there feedback impacted a lot in the method I chose to do this lab.\nLocaliation was obsiousvly the goal to get this lab done with, since that would prove to me the most consistent method. However, even though this method was ideal it did not pan out that way when trying to run it. The ToF sensor kept providing inaccurate measurements of data that caused the robot to believe it was a different location then it was. My biggest belief in this was the ToF sensor being off angled by a few degrees. Even though it is only a few degrees off angle that would cascade in false data being read since it would try to read further distances and max out the ToF. Which when it did max out, for example at the bottom right corner it resulted in false informaiton being provided, and confusing my lil homie robot. After an hour I called it quits and decided to implement the open loop approach which could be implemented in several ways.\nOpen Loop: Now there are 2 main ways I thought about doing this. These 2 different ways was simply the method I choose to go forward wether it was time based or wether it would be from my reading of the ToF. The premise of the open loop method is really simple go forward turn go forward turn go forward and repeat until it did the whole path. While the turning was just reliant on our PID implemenation from lab 6. Here some of the code that was used.\n\n**B. Open Loop **\nUsing the ToF and PID in order to stop the car a certain distance would be the prefered method. This would prove to be the most consistent method since obviously you would stop at the exact distance that you want. However, in order for this to work the ToF had to be very reliable. Which whle testing at first sadly didn't prove to be the case. Furthermore this method required us to get the distances from the walls to the point. However, throughout the numerous runs it would prove to be inconsistent. One was because since tthere was continous people testing there robots on the site, the walls would alter in placements and I didn't help with my robot swerving around and crashing the walls. Resulting in it being off a few cm each iteration, wether it be the sensor reading being to slow for the robot or the envirionment changing. Calculating the distances in a fixed environment wouldn't be to awful especially since the distances from the wall to the robot will always be constant. However, there is a flaw in the fact that the sensor readings might be to slow for more small spaces In a environment changing simulation this would prove not that useful for consistent path sadly as I learned.\nNext something that really doesn't alter the environment and our final method of doing it was just controlling the forward motion of the robot with time. This in theory will always result in consistent forawrd motion, however, in reality this did not always prove to be the case. At times 500 ms was the perfect amount, then it would overshoot then undershoot and rinse and repeat. It became more of a luck based system wether the run was gonna accomplish it or not. To implement this timing it was quite simple we just used some of the logic we used for lab 8 in flipping where we went forward for a set amount of time. Chaning a bit since this time we don't have to collect PWM or ToF sensor data.\n\nFurthermore her is some of the PID orientation code that was used (same code as lab 6)\n\n\nIn order for us to save so much time, instead of hardcoding different values of T and angles we simply create a command in python to ouput the values tbat we wanted as time and angles. Allowing us to keep values that work and also fine tune and tweak the values that we already had.\n\nYou would think this would be streamline to do however, it is not. It took several tries to get it to work once and it took a while for it to run. The video here is 2 minutes long, and I've seen groups doing it much faster. However, Our open loop control was very accurate at the sacrafice for that time. While it is possible to have an accurate and fast localization that is now what I did. Here is the video of the car going through the track:\n\nIn terms of consistency, it will be able to go around the track again however, it won't always be as accurate as the run posted. As mentioned before it is a luck based systems at times it felt wether or not it was going to reach the marks. However, when it did it was very accurate it made our days. There no audio sadly in the video due to the fact a lot of crashing out was occuring throguhout this lab.\nC. Farewell and Resources\n\nHuge shoutout the TAs and Professor Helbling these labs were rigourous however taught us a lot about robot localization. Furthermore shoutout to Aidan Derocher, Jorge Corpa Chung, Jennie Redrovan, Sana Chawla, and Lulu Htutt for being great friends I met from this class and helped throughout this lab and many others. It is sad that I met them this semseter and some of them are graduating, but we shared a lot of suffering and laughter from this class and good memories because of it. Lil Homie, my robot surprisngly never had any issues in terms of wires popping off no matter how much walls he has been thrown at.\n","id":"https://henrycc24.github.io/Labs/lab12/","title":"Lab 12"},"https://henrycc24.github.io/Labs/lab2/":{"body":"\nLab2: Here we are working with the IMU so we can add it to our robot. Experimenting gathering data with the accelerometer and gyroscope, plus making a stunt with our RC robot.\n\nTasks\nLab 2\nThe first lab we look into the examples given in the Ardruino library to test out our Artemis capabilities.\n1. Setting Up the IMU\nBefore we start up the lab we had to connect our IMU to the Artemis board using QWIIC connectors, and connecting it at the I2C port.\nThen we had to install the SparkFun Ardruino library in order to use the senesors provided. However, example_basics didn't work for me so instead I used the example code provided from lecture 4. the AD0_VAL I left it as 1, for when I changed it to 0 my program continously crashed. AD0_VAL is what allows us to connect 2 IMUs at the same time to the board.\n\nTo test out the gyroscope and accelerometer I used the serial plotter and ran the lecture 4 code as shown below.\n\n\nIn the accelerometer data there is a lot of noise when you lay it still, let alone move it around which gives inaccurate measurements. While the Gyro doesn't have as much noise since it dependent on the change of angle.\nTo make sure our IMU is working, after it is setup I implemented it such that it will blink an LED three times as shown below.\n\n2. Accelerometer\n1. Pitch and Roll\n\nTo calculate pitch and roll I used these equations sourced from the lecture. Yaw can't be measured since it's on the same axis of gravity (z-axis), which is why we can only get pirch and roll from the accelerometer. The Accelerometer is fairly accurate when trying to position it and right angles such as {-90, 0, 90} as shown below.\n\nThe main issue with it is that the values flucuate a lot in small increments (noise), even when it held as still as possible or left to sit on a table.\n2. Accelerometer Noise and FFT\n\nSimilar to lab1, to gather accelerometer data we just created a loop that itereated through our data_array_size that in this is also 1000 samples. Using the same equations as before to calculate the roll and pitch. Here are the graphs of the all the data gathered for roll and pitch.\n \n \nThis is the python used to graph it with numpy and plt packages. As well as that using the fft packages with numpy.\n \nAs you can see from the FFT there seems to be a very large peak at the beginning frequencies of the array. It seems to happen at abour &lt;2 Hz, which is what I will use at the cuttoff frequency. It being a low frequency is because the IMU already has a low pass fitler for the accelrometer and gryoscope. However, knowing what our cutoff frequency is then we can calcuate our alpha calue that we can use for a low pass filter to filter out even more noise. The cutoff frequency is important to select to block off any random or high noise, to make are data more stable. To calcualte the alpha we get RC = 1/(2 * pi * 2), then with that RC value we get alpha = dt/(dt+RC). Where dt is the average of change of time for the whole array of calcualted values for roll/pitch. We get an alpha value of .08, which we will use for our low pass filter.\n3. Low-Pass Filter\n\nIn order to create a low pass filter we have to iterate thorugh our orignal roll and pitch data, and then adjust the values with alpha as shown above. After gathering the low-pass data, the graphs are shown below.\n \nAs can be seen, the low-pass filter reduced a lot of noise! Meaning that the our data is even more accurate then it was earlier with the alpha value of .08, which will even come more into play when we do sensor fusion.\n3. Gyroscope\n1. Pitch, Roll and Yaw\n\nThe pitch, roll, and yaw from the gyroscope unlike the accelerometer measure the change in angle/time. To calculate the gyroscope we use a whole different set of equations, where we must include the change in time (dt) which is shown above in my code. Furthermore, the angle of the gryoscrope is dependent on the previous result which showcases a lot of drift. When it laying on a table, there is no change in angle, but since it adding onto itself the roll and pitch as seen by the graphs continously increase over time. On the other hand the accelerometer doesn't have drift, but has a lot of noise which the gyroscope doesn't have.\n \nHere are two images with different sample frequencies. The one of the left is with a smaller sample frequency, while the right has a larger implemented with delays. The larger the sample rate the more drift it will have, which makes sense since dt will be larger when calculating for the roll and pitch. Meaning that you want to have the smallest possible sample rate when calculating gyroscope.\n1. Complementary Filter\nWith the gyroscope and accelerometer we can perform sensor fusion in which we will create a complementary filter. Using the advantages of both sensors, we end up with almost no noise or drift for our calculated roll and pitch.\n\nHere is most of the code used for create the filter, and key to note is that we also use an alpha value, but this alpha is different from our low pass filter one. In this case we need to adjust our alpha to when we start seeing the low-pass filter peak, which is at around 10 Hz as calculated using the FFT graph. Seeing that around that hertz is where it stabilizes, I was able to calculate with the same formula as before the alpha to be .3 which is what I used and it worked really well as shown below.\n \n \nThese graphs are displaying data of me while I was moving and rotating the imu around which is why the normall roll and pitch go hectic. However, as you can see with the zoom in graph (top right), the complementary filter did its job. It was the smoothest graph out of all three options, even though the low pass filter was very similar. However, we can also see that there is a lot of noise if you don't use a lpf. It makes sense though why the complementary filter didn't get too affected cause we push a low-pass filter on a low-pass filter, that is passed on a built in one on a chip. There only room for so much optimization.\n2. Sample Data\nNow its time for optimzation within our code in order to get the fastest sample rate and message sent across. To do this I removed a lot of useless code and print statements that took up time. Furthermore, I removed a lot of the delays and made it such that all the values of accelerometer roll and pitch, gyroscope roll, pitch and yaw, and complementary roll and pitch can be calculated in one command. Meaning that I don't have to call multiple commands since all the calcualtions including the low pass filter of the accelertometer are performed. I also ran some tests to see what would be faster, sending the data live while computing or just computing the array then sending that. To my suprise there was a significant difference between live sending, and sending the data after its collected! If you send it live to gather 1000 samples it took 30 second meaning our sample frequency was very large! This resulted in a cascading affect where of gryoscope was less accurate, which also meant the complementary too. On the otherhand when I first got the 1000 samples then sent it, it was blazing quick at only around 3 seconds to gather all the data! 10x faster then before which also meant our dt was smaller giving us vetter gyroscope data. It still however, took a long time to send but I would rather have that occur then when it's collecting data.\nKnowing this information in order to gather 6 secons I simply just collected 2000 samples as shown below. 2000 samples collected is around 6.3 seconds, but it still took a minute to send it all. I also printed some of the pitch values of all the sensors to showcase it gathering the data.\n\n\nWith this speed of 6.3 seconds to collect 2000 samples, that about 300 samples per second. With the memory size of the Artemis being 384KB, lets just assume you're gathering every data you can from the sensors (10 floats * 4 bytes) meaning that you can collect 9600 sets of data points. Which then at 300 samples per second will end up with it being filled with data in 32 seconds!\nCar Stunt\nNow here me playing around with our RC Car!\n\n","id":"https://henrycc24.github.io/Labs/lab2/","title":"Lab 2"},"https://henrycc24.github.io/Labs/lab3/":{"body":"\nLab3: In This lab we add TOF sensors to transmit distances for our car robot while its traveling.\n\n**Prelab\nFor the prelab, we have to give thought of the place of out ToF sensors. There are several combinations possible, however, I will choose front and back to place my ToF sensors so that it can traverse both forward and reverse knowing if there are any obstacles in the way. However, it will have blind spots at its sides which may cause trouble avodiing obstacles. To use both sensors first, we have to take note of the address of them. Both of them share the address 0x52. This needs to be changed when we run them they don't conflict. To do so one of the sensors we will soder on an extra cable connecting XSHUT to an analog pin on the Artemis. In this case I used A2, and we set the pin LOW in our code then alter the address (I did 0x32), aftewards to use the 2nd one you set the XSHUT high. Allowing both sensors to run at the same time.\n\nWiring Diagram:\n\nTasks\nLab 3\n**1. ToF and Breakout Board **\nUsing the wiring diagram above, we were able to connect the ToF to our breakout board as seen:\n\nNoting that like previous lab, we are able to power it up with the battery and connect to it via bluetooth.\nHere how the board was soldered:\n \n\n**2. Scanning the for Address\n\n\n\n**3. TOF Sensor\n\n \n\n \n\n**4. Multiple ToF and IMU\n\n\n\n\n\n\nKey note is that ToF sensors collect less data points over the same period as the acc and gyro. As can be seen on teh graph ToFs collected ~31 points while acc/gyro collected 2000 io the same time. I had to create a seperate array such that when I graph it the distances won't be zerod out since it there were no distances collected for hundreds of time stamps.\n**5. Limiting Factor\n\n\nAs previousuly mentioned ToF sesnors need time until it can collect data again.  The time it took for a since ToF varied around 6 ms, and the 2nd was longer with 9ms. Which seems extremely small however, relative 2 the other sensors which collect data incredidbly fast it is slow. Which is why when collecing data, i accounted for a seperate time/collection array just so the values didn't bounce to 0. The limiting factor would in this case be 9 ms the longer time to collect data.\n\n","id":"https://henrycc24.github.io/Labs/lab3/","title":"Lab3"},"https://henrycc24.github.io/Labs/lab4/":{"body":"\nLab1: Motor and Open Loop Control\n\nPrelab\nBefore starting the lab we must refreshen up on how to use the oscilloscope and check out the documenation/datasheet for the dual motor driver. While also carefully considering how we would like to arrange our sensors in our car. Note that we use seperate batteries for the motors/artemis since the motors consume more power then the artemis. As well as that the artemis won't be affected by any noise by the motors. The pins I decided to use were analog pins 3, 14, 15, and 16 as shown in the diagram below how i connected them.\n\nTasks\nLab 4\n1. PWM Signals\n\nAfter soldering the motor controllers, befeore I attach them to the motors I tested them out first using an oscilliscope and power supply. To mimic what we will be using as power, I set the power-supply to 3.7 volts. Hooking up the Vin and GND to the power supply, and then Bout1/Aout1 to GND and Bout2 and Aout2 to prope we get these images on the oscilliscope:\n  \nRunning These Code:\n\n2. Take it APART!\nNow we must create an empty husk of the former car shown below:\n\n3. Spinning Motors\nNow we test if our motors function properly. I tested both motors at the same time with a power supply then only with a battery using 150 PWM on both. I tested it going forward and then going backwards as shown. Lifting the car on a small object so it didn't run away.\nPower Supply:\n\nBattery:\n\nCode Used:\n\n4. Stuff It IN!\nNow we must stuff all the sensors we've been working on the previous labs inside the car. Now to make sure there wasn't to much wire loose I resoldered shorter connections and used hotglue/double side tape to fit everything in. Here the layout I choose to do:\n\n\n**5. Lower Limit PWM **\nUnder load it took 60 PWM on both sides to get it moving. While testing it on a desk with a smoother surface then the ground the PWM actually was around 50 for both motors. Wihtout load it took 40 PWM to get it spinning. To pivot in place I made onen side 70 PWM to go right and the other 70 PWM to go left as shown below:\n\n**5. Calliibration Factor **\nBoth motors sadly don't seem to spin at the same rate. However, they are close and to figure out which was stronger I set them equal and let it run. Whichever side turned the more I made weaker just by a little. My factor was 4/5 and can be seen below. After finding it I tested it by going forward then backwards 2m. It important to note that PWM by default is 8 bits (0-255) when configuring it, but it can be changed as shown in an example demo file. Meaning that at max it is 255 which we will later need think about in future labs.\n\n\n**5. Open Loop **\nTo put my car to the test I made it sping around my water bottle a couple of times:\n\nHere the code I used:\n\n","id":"https://henrycc24.github.io/Labs/lab4/","title":"Lab 4"},"https://henrycc24.github.io/Labs/lab5/":{"body":"\nLab5: Linear PID control and Linear Interpolation\n\nPrelab\nThe prelab put heavy emphasis on making sure we can debug properly. Having a base case of the robot turning off if disconnected is almost always necessary since otherwise it might roam around endlessly. While also keep in mind sending the debug information across bluetooth to figure out problems way easier. To send through bluetooth I based the PIT_CONTROl command on the send_three_floats from lab 1 as seen:\n  \nTo send data I used a similar command again from lab 1; where we just send the chararcter arrays of our lists/strings collected.\nTasks\nLab 5\n1. PID Control\nAt a 4000 lvl course I wanted to try out P first then later add on ID parts. Since P is the simplest, if I get that working integrating the other parts will help reduce steady-state and oscillations from occurings. It stops a bit short then expected, however this is most likeley because it only has data in the \"present\" to base of its infomration.\nThe value that will be sent as PWM for the robot will be calculated simply as\nPWM = Kp * error.\nWhere error is the distance from the ToF - (target distance) in this case 1ft. The calculated PWM will regulate the robots speed, and slow it down as it approaches 1ft, where kp will be a constant.\n2. Position Control\nUsing some commands from previous lab I was able to gather that the sampling time of ToF is 20hz (1/.05). However, this sampling rate will be much slower then what the PID control loop will run. When printing out statements it showcased a frequency of 225 Hz which is 10x as fast as what we need. Meaning that sometimes the distance used to calculate error won't be a live distance, but a approximations based off the previous. Knowing that the short sensor has a max range of 1300 mm we do:\n\nu(t) = K_p e(t)\n\\text{Maximum error} = 1300\\text{ mm} - 304\\text{ mm} = 996\\text{ mm}\n255 = K_p \\times 996\nK_p \\approx 0.256\nMeaning that we can use .256 as a balanced kp value that will use almost max power at max range giving good control and speed. However, while experminting I opted to use .1 to have better control of its stopping distance and power control over motors.\n3. PID Implemenation\nNow as mentioned before the ToF won't always be able to provide data for us to calculate error. Knowing this we use the last 2 data points slope, and using the change of time between them we can get a estimation of where the car is as shown below. This value, adn the ToF reading will be appeneding to the same array meaning that both values will always be avaiable for doing this calculation.\nWith these calcuations, we get a PWM signal produced with the kp and error. Depending on what this PWM signal will indicate wether the robot should slow down, speed up, go forward, or go backwards which the logic behind that is shown below. As mentioned in a previous lab, 255 is max and if we get a PWM signal that greater we automatically set it as 255 to the robot. Otherwise we make sure the PWM signal doesn't go below 50 otherwise we won't have enough power to move. Lastly, if PWM does become 0 then that means we reached the desired distance.\n  \nHere is a video of it using the P algorithim to stop ~ a 1ft away from the wall.\n\n","id":"https://henrycc24.github.io/Labs/lab5/","title":"Lab 5"},"https://henrycc24.github.io/Labs/lab7/":{"body":"\nLab7 : Kalman Filter Implementation\n\nTasks\nLab 7\n**1. Estimating Drag and Momentum **\nTo build the state space model we need to calculate drag and momentum terms for the A and B matrices. First we must choose a step resone (PWM Value) to run the car at.  I chose a PWM of 124\n \n\nThese are the associated speed, position, and PWM graphs I got from my car.\nWith these values collected I calculated the drag and momentum using these formulas from lecture.\n \nImplementing it in Python:\n \nTo calculate these values I needed to get a steady state value for my speed. I used 1st order system formula from lecture 14 slides:\n\nTo get a value of 2133 mm/s. which for 90% will get you 1919.7 mm/s. For the dt I calculated by finding the avgerage sampling rate of all the collected values which turned out to be .009 seconds.\n**2. Initializing KF **\n \n \nFollowing the formulas from the same lecture we use the momentum and drag values we calculated to get arrays A and B. Keeping in mind that dt is our sampling rate from earlier.\nC is an m x n matrix where n are the dimenstion in the state space and m are the # of states. For this we set it as [1,0] since we are measuring positive distance from the wall (state 0)\n\nNext we have to intialize the state vector. The first position is the first reading from the TOF at rest. The velocity is set to 0 since the car isn't moving.\n \nFollowing that we now need to calculate our sigma z and u matrixes. To do this we need to find the standard deviation of our measurment and process noise. Sigma 3 is set at 20 mm to match the ranging error of long distance mode which was used to collect data for the ToF.\n\nFor sigma 1 and sigma 2 used the formula $\\sqrt{u * (1/dt) }$ where u in our case will be the mean value of 10. This gave us a sigma of ~33 mm/s where sigma 1 correlates with the trusted model position and sigma 2 is speed.\n3. Kalman Filter in Jupyter\n\nNext was implementing the filter in jupyter notebook. To do this I based my code from the provided code in lecture, and set an intial sigma with similar paramters to before. However, this time I set the sigma1 to a value of 143mm/s since this was the value i calculated when I took the std of my velocity. I wanted to get a more precise value for this case to see if it'll line up more. This is the resulting graph of it. The other graph where the end values don't match up as nice is the result of me using a insital sigma of 20. This change in value led to a significant change in graph especially since when squared 400 &lt;&lt; 20,000.\n\n\nI wanted to experiment with different dt values, and to do so I simply tested it by adding serial print statments to slow down the ToF.\n\nRunning the KF filter with base paramters as before actually gave pretty code results even with a lower dt. Dt directly changes the Ad array, the momentum calcualtion, and sigma values used for these matrixes, hwoever, as long as you configure it right it can accurately display the steady state in the system. The above image is showcasing a dt of .223 which is ~2.4 times slower then the original of .09.\n4. Running it on the lil Homie\nAlright now for the true test running it on my robot lil Homie. First of we have to include the linear algebra library and download it doing\n#include &lt;BasicLinearAlgebra.h&gt;\nAlright to implement in C took a while however, since it was first coded in python it was just like translating a different language and such we got these following functions/code:\n \n\nUnlke lab5 there is no extroplation being taken place here. Instead how it works is that if the sensor is ready it will provide its current position and feed it into the kalman filter, and then the kalman filter will output its state vector which then again will call our PID function that we implemented last time. In which we have a designeted distance (1ft ~ 300 mm) that we want our robot to be away from.\n\nHere a graph of it which accurately displays how it ran where it was to close then backed up and once it hits it distance it shut off the PWM. As shown below:\n\n","id":"https://henrycc24.github.io/Labs/lab7/","title":"Lab 7"},"https://henrycc24.github.io/Labs/lab8/":{"body":"\nLab8 : Flipparino\n\nTasks\nLab 8\nA. Flipparino Code\nThe task I decided to do was flipping my robot, little homie, and driving it backwards over where it started. To implement this I simply hardcoded everything. No PID or Klarman filter was used I simply sent my robot forward and then backwards as shown in the code below.\n \nHere at the begging of my code I made by robot collect some data for a few seconds before operating by making sure the PWM was set at 0. After a few seconds I made it go full throttle to the wall at 255 PWM even though I know the max is around 180 I just maxed it out on both pins just to be safe. In order to actually flip the robot I simply made it go backwards full throttle at 255 PWM as well. At first I had it stop to try to flip it however, it wouldn't just turn off the motor immediately causing it to drift a bit. To stop this issue, I simply removed it stopping instead it transitioned immediately to reverseing which worked out much better as seen by the videos.\n**B. Flipping Robot Adjustments **\nHaving the code was the simple part the most difficult part was making sure the robot had the physical criteria to flip each time I ran it.\n \nAt first I was testing out drifting and tapped all my wheels in order for there to be less friction created, allowing it to drift easier. However, when I decided to go to flipping instead initally I left the tape on all the wheels. However, this caused issues since the car never was able to create enough momentum in order flip properly. This was due to the front wheels not gaining enough traction to allow for the back wheels to simply flip over even with added weights. To resolve this I simply removed the front wheel tapes, but left the back wheels tape in order for it to be easier for it to flip. With the wheels on the back with tape this meant that it would have less traction and static friction that needed to be overcome to allow it to flip which worked really well for flipping.\nIn addition to this I added weights inside the battery comparment of my robot. The weights I decided to use were 3 pebbles that I found that fit perfectly inside. These 3 pebbles helped anchor the front wheels when it transtions from forawrd to backward allowing it to pivot the back wheels to do a complete 180.\nLastly, the biggest factor that I found was friction! Throughout testing I saw that my car intially flipped at my first runs but then suddenly seemed to lose all momentum and stayed on the ground. I realized that the front wheels were collecting so much floor dust that it lost all its traction! This meant that it wasn't able to hold its position and flip properly, meaning for every trial ran I wanted to test I manually grabbed a gloth soaked it and cleaned the front wheels to make sure they had enough grip!\nC. Data Collection and Stunts\nAll the data was collected while running. Some of the ToF data measured was off a bit since one trial the robot has a bit of a skew when returning pack. The PWM graphs are practically the same since at all times it was running at full throttle just at different pins which are showcased. The robot was started at 100 inches from the wall which can bee seen in all the data collected with its intial ~2661 mm data points at the beginning. Then it flipping at aroun 17 mm, then going fully reverse. Since reverse it was the reamining of the room the total isn't 100% accurate since now the ToF is reading away from the wall and then getting picked up or running into a chair. The sticky pad was use a reference guide to determine where the robot should flip at around 17 mm as mentioned before.\nTrial 1\n \n\nThis was by far the fastest trial with 2.28 seconds from start to back!\nTrial 2\n \n\nSince this trial it kinda hit a chair the leg while reading and end the ToF data is kinda sparatic as seen by the graph. This one was around 2.4 s\nTrial 3\n \n\nLastly my last trial probaly my most stable as well with 2.43 seconds clocked in.\nC. Bloopers\n\nYeah so I had a lot of failed trials couldn't choose one so made a compilation :D\n","id":"https://henrycc24.github.io/Labs/lab8/","title":"Lab 8"},"https://henrycc24.github.io/about/":{"body":"\n\nMy name is Henry Calderon. I'm currently a Junior ECE major at Cornell University. I enjoy hardware the most which is why my main interests in my major are embedded systems and robotics!\n\n","id":"https://henrycc24.github.io/about/","title":"About me"}},"docInfo":{"https://henrycc24.github.io/":{"body":38,"title":2},"https://henrycc24.github.io/Labs/":{"body":0,"title":1},"https://henrycc24.github.io/Labs/lab1/":{"body":708,"title":2},"https://henrycc24.github.io/Labs/lab10/":{"body":323,"title":2},"https://henrycc24.github.io/Labs/lab12/":{"body":557,"title":2},"https://henrycc24.github.io/Labs/lab2/":{"body":781,"title":2},"https://henrycc24.github.io/Labs/lab3/":{"body":223,"title":1},"https://henrycc24.github.io/Labs/lab4/":{"body":291,"title":2},"https://henrycc24.github.io/Labs/lab5/":{"body":330,"title":2},"https://henrycc24.github.io/Labs/lab7/":{"body":402,"title":2},"https://henrycc24.github.io/Labs/lab8/":{"body":415,"title":2},"https://henrycc24.github.io/about/":{"body":18,"title":0}},"length":12},"lang":"English"}